import Head from "next/head";

export default () => (
  <div>
    <Head>
      <meta name="viewport" content="width=device-width, initial-scale=1" />
      {/* <link rel="stylesheet" href="/static/main.css" /> */}
    </Head>
    <style jsx global>{`
      body {
        margin: 0;
      }
      #__next {
        height: 100vh;
        display: flex;
        flex-direction: column;
        background: #102030;
        color: #b7ddf4;
      }
    `}</style>
  </div>
);
